    return (
      <>
      {console.log(console.log('te', STATES))}
        <div className="row" style={{ marginBottom: "15px" }}>
          <div className="col-md-12">
            <Button
              type="primary"
              icon={<PlusOutlined />}
              size="large"
              style={{ float: "right" }}
              onClick={() => this.showModal("cadastrar")}
            >
              Planos disponíveis
            </Button>
          </div>
        </div>
        <Card title="Barragens">
          <br />
          <div className="row">
              <div className="col-md-6">
                <div className="bs-component">
                  <FormGroup label="Estado">
                    <SelectMenu
                      value={formData.uf}
                      className="form-control"
                      lista={STATES}
                      onChange={(e) =>
                        setFormData({ uf: e.target.value, ...formData
                         })
                      }
                    />
                  </FormGroup>
                  <FormGroup htmlFor="latitude" label="Estado*">
                    <input
                      value={this.state}
                      type="number"
                      className="form-control"
                      id="inputNome"
                      aria-describedby="emailHelp"
                      placeholder="Digite a latitude"
                      onChange={(e) =>
                        this.setState({ latitude: e.target.value })
